import React from 'react';
import './App.css';
import { AllNoteProvider, useAllNotes } from './contexts/notes';
import Home from './pages/Home';
import { BrowserRouter } from "react-router-dom";


function App() {

  return (
    <AllNoteProvider>
      <div className="App">
        <Home />
      </div>
          <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home/>}/>
          </Routes>
        </BrowserRouter>
    </AllNoteProvider>
  );
}

export default App;
